import React from 'react'
import './App.css';

const App = () => {

  handleFetch = () => {
    fetch('developer.marvel.com')
    .then(res => res.json())
    .then(data => console.log(data))
  }


  return (
    <div className="App">
      <h1>Hello</h1>
    </div>
  );
}

export default App;
